El poema es un soneto conocido de Francisco de Quevedo (1580-1645), que forma parte de su obra poética. Es característico de su estilo conceptista y presenta juegos de palabras típicos del Barroco español, incluyendo paronomasias (palabras que suenan similar pero tienen diferente significado) al final de varios versos.
